import React, { useState } from 'react';

const Header = () => {
    const [darkMode, setDarkMode] = useState(false);

    return (
        <div id="head" className={`header-container ${darkMode ? 'dark-mode' : ''}`}>
            {/* ... other elements ... */}
            <button onClick={() => setDarkMode(!darkMode)} className="theme-toggle">
                Toggle Theme
            </button>
        </div>
    );
};
